import React from 'react';
import {
  SiHtml5, SiCss3, SiJavascript, SiReact, SiTailwindcss, SiSass, SiFigma,
  SiPhp, SiNodedotjs, SiLaravel, SiExpress, SiMysql, SiMongodb, SiNextdotjs, SiNginx, SiApache,
  SiPython, SiAstro, SiDocker, SiTypescript,
  SiGit, SiGithub, SiVscode, SiNpm, SiWordpress, SiGnubash,
} from 'react-icons/si';

const categories = [
  {
    title: 'Frontend',
    color: 'text-cyan-300',
    items: [
      { name: 'HTML', icon: <SiHtml5 /> },
      { name: 'CSS', icon: <SiCss3 /> },
      { name: 'JavaScript', icon: <SiJavascript /> },
      { name: 'ReactJS', icon: <SiReact /> },
      { name: 'TailwindCSS', icon: <SiTailwindcss /> },
      { name: 'SASS', icon: <SiSass /> },
      { name: 'Figma', icon: <SiFigma /> },
    ],
  },
  {
    title: 'Backend',
    color: 'text-green-400',
    items: [
      { name: 'PHP', icon: <SiPhp /> },
      { name: 'NodeJS', icon: <SiNodedotjs /> },
      { name: 'Laravel', icon: <SiLaravel /> },
      { name: 'ExpressJS', icon: <SiExpress /> },
      { name: 'MySQL', icon: <SiMysql /> },
      { name: 'MongoDB', icon: <SiMongodb /> },
      { name: 'Next.js', icon: <SiNextdotjs /> },
      { name: 'Nginx', icon: <SiNginx /> },
      { name: 'Apache', icon: <SiApache /> },
    ],
  },
  {
    title: 'Aprendiendo',
    color: 'text-orange-300',
    items: [
      { name: 'Python', icon: <SiPython /> },
      { name: 'Astro', icon: <SiAstro /> },
      { name: 'Docker', icon: <SiDocker /> },
      { name: 'TypeScript', icon: <SiTypescript /> },
    ],
  },
  {
    title: 'Herramientas',
    color: 'text-blue-300',
    items: [
      { name: 'Git', icon: <SiGit /> },
      { name: 'GitHub', icon: <SiGithub /> },
      { name: 'Terminal', icon: <SiGnubash /> },
      { name: 'VSCode', icon: <SiVscode /> },
      { name: 'npm', icon: <SiNpm /> },
      { name: 'WordPress', icon: <SiWordpress /> },
    ],
  },
];

export default function Technologies() {
  return (
    <section id="technologies" className="py-12 bg-neutral-900 text-white px-6">
      <div className="max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-8">
        {categories.map((category) => (
          <div key={category.title} className="bg-neutral-800 rounded-xl p-6 shadow-lg">
            <h3 className={`text-2xl font-bold mb-4 ${category.color}`}>{category.title}</h3>
            <div className="flex flex-wrap gap-4">
              {category.items.map((item) => (
                <div
                  key={item.name}
                  className="flex flex-col items-center w-20 text-sm hover:scale-105 transition-transform"
                >
                  <div className="text-3xl mb-1">{item.icon}</div>
                  <span className="text-center">{item.name}</span>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
